速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限);
速度Z = (速度X * 距离Z / 距离X ) * (10 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

if (速度X >= 0)
{
	左速度 = 速度X * 2;
	左右加速度 = 速度X * 2 / 追踪持续帧;
}
else
{
	右速度 = -速度X * 2;
	左右加速度 = -速度X * 2 / 追踪持续帧;
}
if (速度Z >= 0)
{
	上速度 = Math.min(速度Z, 速度上限 * 1);
}
else
{
	下速度 = Math.min(-速度Z, 速度上限 * 1);
}

//本帧是进行一定特殊曲线移动的帧，不具有太多参考价值

//你需要改的值
速度上限 = _parent.行走X速度 * 1.5;
追踪持续帧 = 12;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧, -速度上限), 速度上限) * (10 + random(5)) / 10;
速度Z = (速度X * 距离Z / 距离X ) * (10 + random(5)) / 10 ;
上下加速度 = 0;
左右加速度 = 0;

if (速度X >= 0)
{
	左速度 = 速度X;
}
else
{
	右速度 = -速度X;
}
if (速度Z >= 0)
{
	上速度 = Math.min(速度Z, 速度上限 * 1);
	上下加速度 = 上速度 * 1 / 追踪持续帧;
}
else
{
	下速度 = Math.min(-速度Z, 速度上限 * 1);
	上下加速度 = 下速度 * 1 / 追踪持续帧;
}

//本帧是锁定敌人位置的帧，建议比位移元件早一些。

//你需要改的值，追踪持续帧是从挂载ef的位移元件的第二帧到预计实际到达敌人位置时的总帧数。
速度上限 = _parent.行走X速度 * 2;
追踪持续帧 = 10;

//自动计算的值
敌方目标 = _root.gameworld[_parent.攻击目标];
上速度 = 0;
下速度 = 0;
左速度 = 0;
右速度 = 0;
距离X = _parent._x - 敌方目标._x;
距离Z = _parent.Z轴坐标 - 敌方目标.Z轴坐标;
速度X = Math.min(Math.max(距离X / 追踪持续帧,-速度上限),速度上限);
速度Z = 速度X * 距离Z / 距离X;

if (速度X >= 0)
{
	左速度 = 速度X;
}else
{
	右速度 = -速度X;
}
if (速度Z >= 0)
{
	上速度 = 速度Z;
}else
{
	下速度 = -速度Z;
}

敌方目标 = _root.gameworld[_parent.攻击目标];
if (_parent._x > 敌方目标._x)
{
	_parent.方向改变("左");
}
else if (_parent._x < 敌方目标._x)
{
	_parent.方向改变("右");
}

